import React from 'react';
// import Heart from '../../../assets/white.png';
import Link from 'next/link';
import Image from '../../UI/Image/Image';

const post = (props)=>(
        <div className="row">
                <h6>{props.name}</h6>
                <Image image={props.image}/>
                <Link href={{ pathname: 'http://localhost:8080/add', query: { name: 'Zeit' } }}>
                    <button ><img src="" alt="" />button</button>
                </Link>
                <style jsx>
                {`
                    h6{
                        color: blue;
                    }
                    img {
                        max-width: 100%;
                        height: auto;
                    }
                    button{
                        position: absolute;
                        top: 90%;
                        left: 80%;
                        transform: translate(-50%, -50%);
                        -ms-transform: translate(-50%, -50%);
                        background-color: #555;
                        color: white;
                        font-size: 16px;
                        padding: 12px 24px;
                        border: none;
                        cursor: pointer;
                        border-radius: 5px;
                    }
                `}    
                </style>
                <hr/>
        </div>
);



export default post;
